import "./contact.scss";
import { GitHub, Mail, LinkedIn } from "@material-ui/icons";
export default function Contact() {
  return (
    <div className="contact" id="contact">
      <div className="left">
        <img src="assets/shake.svg" alt="" />
      </div>
      <div className="right">
        <h1>Find me here! </h1>
        <a href="https://github.com/shubhangi013">
        <GitHub className="icon"></GitHub>Github Handle</a>
        <a href="https://www.linkedin.com/in/shubhangi-choudhary-32a347205/"><LinkedIn className="icon"></LinkedIn>LInkedIn Handle</a>
        <a href=" mailto:choudharyshubhangi13@gmail.com "><Mail className="icon"></Mail>Mail to me! </a>
      </div>
    </div> 
  );
}
